// Get the response data
const response = $input.first().json;
const items = response.items || [];

// Track pagination info
let nextStartIndex = 1;
if (response.queries && response.queries.nextPage && response.queries.nextPage[0]) {
  nextStartIndex = response.queries.nextPage[0].startIndex;
}

// Calculate if we should continue (Google only allows up to 100 results)
const hasMoreResults = nextStartIndex <= 100;

// Process the items and include pagination info in each item
const results = items.map(item => {
  const titleParts = item.title.split(" - ");
  const meta = item.pagemap?.metatags?.[0] || {};

  // --- Added title cleaning logic ---
  let rawTitle = meta["og:title"] || item.title || "";
  const name = titleParts[0] || "";

  // Remove "| LinkedIn" at the end
  let cleanedTitle = rawTitle.replace(/\s*\|\s*LinkedIn\s*$/i, "").trim();

  // Remove name from start if present
  if (name && cleanedTitle.toLowerCase().startsWith(name.toLowerCase())) {
    cleanedTitle = cleanedTitle.replace(new RegExp("^" + name + "\\s*-\\s*", "i"), "").trim();
  }
  // --- End of new logic ---

  return {
    name: name || null,
    title: cleanedTitle || null, // <-- cleaned title applied here
    link: item.link || null,
    snippet: meta["og:description"] || item.snippet || null,
    image: item.pagemap?.cse_image?.[0]?.src || item.pagemap?.cse_thumbnail?.[0]?.src || null,
    startIndex: nextStartIndex,
    hasMoreResults: hasMoreResults,
  };
});

// If there are no results, return at least one item with pagination info
if (results.length === 0) {
  return [{
    json: {
      name: null,
      title: null,
      link: null,
      snippet: null,
      image: null,
      startIndex: nextStartIndex,
      hasMoreResults: false,
    },
  }];
}

// Return the processed results
return results.map(r => ({ json: r }));

// Get all input items
const inputItems = $input.all();
console.log("Input items count:", inputItems.length);

let nextStartIndex = 2; // default
let hasMoreResults = false; // default

if (inputItems && inputItems.length > 0) {
  const firstItem = inputItems[0];

  if (firstItem.json) {
    console.log("First item JSON:", JSON.stringify(firstItem.json));
  }

  // ‚úÖ Corrected property names
  if (firstItem.json.startIndex !== undefined) {
    nextStartIndex = firstItem.json.startIndex;
    console.log("Found startIndex:", nextStartIndex);
  }

  if (firstItem.json.hasMoreResults !== undefined) {
    hasMoreResults = firstItem.json.hasMoreResults;
    console.log("Found hasMoreResults:", hasMoreResults);
  }
}

// ‚úÖ Return pagination control info
return [
  {
    json: {
      continueLoop: hasMoreResults,
      startIndex: nextStartIndex,
    },
  },
];
